&lt;li&gt;With sleeve lock mechanism (Except KK2)&lt;/li&gt;
&lt;li&gt;Effective area: 3.8 to 82mm&amp;sup2;&lt;/li&gt;
&lt;li&gt;Weight: 6.1 to 87.7g&lt;/li&gt;
&lt;li&gt;Fluids: air and water&lt;/li&gt;
&lt;/ul&gt;

